import Cost from "./components/Costs";

function App() {
  const cost = [
    {
      date: new Date(2023, 2, 15),
      description: "Холодильник",
      amount: 999.99,
    },

    {
      date: new Date(2023, 2, 21),
      description: "Ноутбук",
      amount: 1275.78,
    },

    {
      date: new Date(2023, 2, 27),
      description: "Одежда",
      amount: 500.66,
    },
  ];

  return (
    <div>
      <h1>Начинаем изучение React</h1>
      <Cost costs={cost}/>
    </div>
  );
}

export default App;
